import React from "react";
import { lookup } from "./constants.js";
const Content = (title) => {
  const contentDetails = lookup[title["title"]];
  const contentTitle = contentDetails["title"],
    contentSrc = contentDetails["src"];
  console.log(contentSrc, contentTitle);
  if (contentTitle === "iframe") {
    return <iframe title={"video"} src={contentSrc}></iframe>;
  }
  if (contentTitle === "img") {
    return <img src={contentSrc} alt="dead pic lmao"></img>;
  }
  if (contentTitle === "textarea") {
    return <textarea></textarea>;
  }
};

export default Content;
